import React from 'react';
import ReactDOM from 'react-dom/client';
import reportWebVitals from './reportWebVitals';


function Login() {
    return (
        <div className="LoginPage" style={{width: 1440, height: 1024, position: 'relative', background: 'white'}}>
        <div className="LoginBox" style={{width: 811, height: 578, left: 315, top: 223, position: 'absolute', background: '#D9D9D9', borderRadius: 94}} />
        <div className="Welcome" style={{left: 618, top: 269, position: 'absolute', textAlign: 'center', color: 'black', fontSize: 48, fontFamily: 'Outfit', fontWeight: '700', wordWrap: 'break-word'}}>Welcome</div>
        <div className="LoginToContinue" style={{left: 584, top: 339, position: 'absolute', textAlign: 'center', color: 'black', fontSize: 36, fontFamily: 'Outfit', fontWeight: '400', wordWrap: 'break-word'}}>Login to continue</div>
        <div className="NameSelectorDropBox" style={{width: 443, height: 49, left: 499, top: 487, position: 'absolute', background: 'white'}} />
        <div className="LoginBtn" style={{width: 212, height: 72, left: 614, top: 631, position: 'absolute'}}>
            <div className="Rectangle4" style={{width: 212, height: 66, left: 0, top: 0, position: 'absolute', background: '#F5F5F5', borderRadius: 22}} />
            <div className="Login" style={{width: 89, height: 59, left: 62, top: 13, position: 'absolute', textAlign: 'center', color: 'black', fontSize: 32, fontFamily: 'Outfit', fontWeight: '500', wordWrap: 'break-word'}}>Login</div>
        </div>
        </div>

    );
}

export default Login;
